          Name = [[crystfel
  Version:  0.11.1
  ## Description ## 
  
  crystfel is a suite of programs for processing diffraction data acquired
  "serially" in a "snapshot" manner, such as when using the technique of Serial
  Femtosecond Crystallography (SFX) with a free-electron laser source. crystfel
  comprises programs for indexing and integrating diffraction patterns, scaling
  and merging intensities, simulating patterns, calculating figures of merit for
  the data and visualising the results. Supporting scripts are provided to help
  at all stages, including importing data into CCP4 for further processing.
  
