          Name = [[ldhelmet
  Version:  1.10
  ## Description ## 
  
  LDhelmet is a software program for statistical inference of fine-scale
  crossover recombination rates from population genetic data. LDhelmet expects
  the input data to be phased and aligned DNA sequences. The statistical model
  assumes the sample of DNA sequences is randomly drawn from a single
  population, and that the population followed a neutral evolution with constant
  population size. However, the statistical inference can still be accurate even
  with mild deviations from these assumptions. LDhelmet can handle sample sizes
  of up to 50 individuals (haplotypes), and is suitable for whole-genome
  sequence analysis.
  
  For more information, visit: 
